INSERT INTO `recept` VALUES (1,'2025-01-29 14:12:10','2025-01-29 14:12:10',NULL,0,1,'Pizza Margherita','Pomiješajte brašno, kvasac, vodu i so. Ostavite tijesto da naraste. Premažite umakom od rajčice, pospite sirom i začinima, a zatim pecite 10-12 minuta na 220°C.'),(2,'2025-01-29 14:12:37','2025-01-29 14:12:37',NULL,0,2,'Piletina u umaku od gljiva','Piletinu ispecite na tavi, a zatim dodajte gljive, vrhnje za kuhanje, bijelo vino i začine. Kuhajte dok umak ne zgusne. Poslužite uz prilog po izboru.'),(3,'2025-01-29 14:12:51','2025-01-29 14:12:51',NULL,0,3,'Rižoto s plodovima mora','Na maslacu popržite luk i češnjak, dodajte rižu i zalijte s malo bijelog vina. Postupno dodajte temeljac i kuhajte dok riža ne upije svu tekućinu. Dodajte plodove mora i kuhajte još nekoliko minuta.'),(4,'2025-01-29 14:13:03','2025-01-29 14:13:03',NULL,0,4,'Burger s pomfritom','Sastavite burger od mljevene govedine, začina i povrća. Pecite na tavi ili roštilju. Poslužite s domaćim pomfritom.'),(5,'2025-01-29 14:13:26','2025-01-29 14:13:26',NULL,0,5,'Pasta Carbonara','Skuhajte tjesteninu. Na tavi popržite pancetu, dodajte vrhnje i jaja. Pomiješajte s kuhanom tjesteninom i pospite sirom.'),(6,'2025-01-29 14:13:40','2025-01-29 14:13:40',NULL,0,6,'Goveđi stek','Pecite goveđi stek na roštilju ili tavi. Za umak, pomiješajte maslac, češnjak i začine. Poslužite uz prilog povrća ili krumpira.'),(7,'2025-01-29 14:14:06','2025-01-29 14:14:06',NULL,0,7,'Pašticada','Govedinu marinirajte u crnom vinu, povrću i začinima. Kuhajte u umaku od rajčice i crnog vina nekoliko sati. Poslužite uz njoke ili šufnudle.'),(8,'2025-01-29 14:14:16','2025-01-29 14:14:47',NULL,0,8,'Caprese salata','Pomiješajte svježi mozzarella sir, rajčicu i svježi bosiljak. Prelijte s maslinovim uljem i balzamičnim octom.'),(9,'2025-01-29 14:15:09','2025-01-29 14:15:09',NULL,0,9,'Lignje na žaru','Lignje očistite, začinite i stavite na roštilj. Poslužite uz limun i prilog po izboru.'),(10,'2025-01-29 14:15:25','2025-01-29 14:15:25',NULL,0,10,'Tiramisu','Pomiješajte mascarpone, jaja, šećer i kavu. Na dno posude stavite piškote natopljene u kavi, prelijte kremom, a zatim ponovite postupak. Ostavite u hladnjaku nekoliko sati.'),(11,'2025-01-29 14:15:37','2025-01-29 14:15:37',NULL,0,1,'Lasagna','Kuhajte mljeveno meso s povrćem, umakom od rajčice i začinima. Naizmjenično slažite slojeve umaka, tijesta za lazanje i bešamel umaka. Pecite u pećnici 45 minuta.'),(12,'2025-01-29 14:15:48','2025-01-29 14:15:48',NULL,0,2,'Škampi na buzaru','Škampe skuhajte u umaku od maslinovog ulja, češnjaka, rajčice, vina i začina. Poslužite s tjesteninom ili kruhom.'),(13,'2025-01-29 14:16:02','2025-01-29 14:16:02',NULL,0,3,'Focaccia','Pomiješajte brašno, kvasac, maslinovo ulje i vodu. Ostavite da naraste, pa oblikujte tijesto i prelijte s maslinovim uljem i ruzmarinom. Pecite na 200°C 20 minuta.'),(14,'2025-01-29 14:16:13','2025-01-29 14:16:22',NULL,0,4,'Grilled Cheese Sandwich','Na kruh stavite sir i maslac, a zatim tostirajte na tavi dok ne postane zlatno smeđi.'),(15,'2025-01-29 14:16:39','2025-01-29 14:16:39',NULL,0,5,'Crni rižoto','Skuhajte rižu s crnom sepijom, pomiješajte s povrćem i temeljcem. Začinite sa soli, paprom i maslinovim uljem.'),(16,'2025-01-29 14:16:56','2025-01-29 14:16:56',NULL,0,6,'Sarma','Kuhajte mljeveno meso s rižom, začinima i povrćem, a zatim zamotajte u kiseli kupus. Kuhajte u loncu nekoliko sati.'),(17,'2025-01-29 14:17:10','2025-01-29 14:17:10',NULL,0,7,'Štrukli','Napravite tijesto za štrukle i napunite ga mješavinom svježeg sira i jaja. Kuhajte u vodi ili pecite u pećnici.'),(18,'2025-01-29 14:17:22','2025-01-29 14:17:22',NULL,0,8,'Zagorski štrukli','Prvo napravite tijesto za štrukle, a zatim punite svježim sirom i pavlakom. Pecite dok ne postane zlatno smeđe.'),(19,'2025-01-29 14:17:51','2025-01-29 14:17:51',NULL,0,9,'Pohana piletina','Piletinu uvaljajte u brašno, jaja i krušne mrvice, a zatim pržite u dubokom ulju dok ne postane hrskava.'),(20,'2025-01-29 14:18:03','2025-01-29 14:18:11',NULL,0,10,'Salata od tune','Pomiješajte konzerviranu tunu s kuhanim jajima, krastavcima, lukom, maslinama i prelije s maslinovim uljem i limunom.');
